import React from 'react'
import { TimeSeries } from "pondjs";
import { Charts, ChartContainer, ChartRow, YAxis, LineChart } from "react-timeseries-charts";

const TimeGraph = (props) =>{
    const {pricematrix} = props;
    const data = {
        columns: ["time", "value"],
        points: [
            pricematrix
        ]
    };
    const timeseries = new TimeSeries(data);
    return(
        <div>
            <ChartContainer timeRange={timeseries.timerange()} width={350} format="month">
                <ChartRow height={100}>
                    <YAxis id="axis1" format="$.2f" width="60" type="linear" min={timeseries.min()} max={timeseries.max()}/>
                    <Charts>
                        <LineChart axis="axis1" series={timeseries}/>
                    </Charts>
                </ChartRow>
            </ChartContainer>
        </div>
    )
}
export default TimeGraph
